import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import { useI18n } from '../../context/I18nContext';
import { useTheme } from '../../context/ThemeContext';

const LandingPage = () => {
  const { t, lang } = useI18n();
  const { isDark } = useTheme();

  const heroStyle = {
    minHeight: '100vh',
    background: isDark ? '#0a0a0f' : '#0a0a0f',
    color: 'white',
    position: 'relative',
    overflow: 'hidden',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  };

  const backgroundPattern = {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundImage: `
      radial-gradient(circle at 20% 80%, rgba(120, 119, 198, 0.3) 0%, transparent 50%),
      radial-gradient(circle at 80% 20%, rgba(255, 119, 198, 0.15) 0%, transparent 50%),
      radial-gradient(circle at 40% 40%, rgba(120, 219, 255, 0.1) 0%, transparent 50%)
    `,
    opacity: 0.6
  };

  const glowingLines = {
    position: 'absolute',
    width: '100%',
    height: '100%',
    top: 0,
    left: 0,
    background: `
      linear-gradient(45deg, transparent 30%, rgba(120, 119, 198, 0.1) 50%, transparent 70%),
      linear-gradient(-45deg, transparent 30%, rgba(255, 119, 198, 0.1) 50%, transparent 70%)
    `,
    backgroundSize: '200px 200px',
    animation: 'float 20s ease-in-out infinite'
  };

  return (
    <div style={heroStyle}>
      {/* Background Pattern */}
      <div style={backgroundPattern}></div>
      <div style={glowingLines}></div>
      
      {/* Main Content */}
      <div className="container" style={{ position: 'relative', zIndex: 10, textAlign: 'center' }}>
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
        >
          {/* Logo */}
          <motion.div
            initial={{ scale: 0 }}
            animate={{ scale: 1 }}
            transition={{ duration: 0.6, delay: 0.1 }}
            style={{
              display: 'flex',
              justifyContent: 'center',
              marginBottom: '40px'
            }}
          >
            <div style={{
              width: '60px',
              height: '60px',
              background: 'linear-gradient(135deg, #7877c6 0%, #ff77c6 100%)',
              borderRadius: '12px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              fontSize: '24px',
              fontWeight: 'bold',
              color: 'white',
              boxShadow: '0 10px 30px rgba(120, 119, 198, 0.4)'
            }}>
              AT
            </div>
          </motion.div>

          {/* Main Headline */}
          <motion.h1
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.3 }}
            style={{
              fontSize: lang === 'ar' ? '48px' : '56px',
              lineHeight: 1.2,
              marginBottom: '24px',
              fontWeight: 800,
              background: 'linear-gradient(135deg, #4facfe 0%, #7877c6 50%, #ff77c6 100%)',
              backgroundClip: 'text',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              textAlign: 'center'
            }}
          >
            {lang === 'ar' ? (
              <>
                <span style={{ color: '#4facfe' }}>عزز موقعك</span>{' '}
                <span style={{ color: '#ff77c6' }}>بالذكاء الاصطناعي</span>
              </>
            ) : (
              <>
                <span style={{ color: '#4facfe' }}>BOOST YOUR</span>{' '}
                <span style={{ color: '#ff77c6' }}>WEBSITE WITH AI</span>
              </>
            )}
          </motion.h1>

          {/* Subtitle */}
          <motion.p
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            style={{
              color: '#cbd5e1',
              maxWidth: '600px',
              margin: '0 auto 40px',
              fontSize: '18px',
              lineHeight: 1.6,
              textAlign: 'center'
            }}
          >
            {lang === 'ar' ? 
              'الذكاء الاصطناعي يمكنه تعزيز التفاعل وتحسين الكفاءة وزيادة التحويلات. ابق متقدماً على المنافسة.' :
              'AI can enhance engagement, improve efficiency, and drive conversions. Stay ahead of the competition.'
            }
          </motion.p>

          {/* CTA Buttons */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.5 }}
            style={{
              display: 'flex',
              gap: '20px',
              justifyContent: 'center',
              flexWrap: 'wrap'
            }}
          >
            <Link
              to="/register"
              style={{
                background: 'linear-gradient(135deg, #7877c6 0%, #ff77c6 100%)',
                color: 'white',
                padding: '16px 32px',
                borderRadius: '12px',
                textDecoration: 'none',
                fontWeight: '600',
                fontSize: '16px',
                boxShadow: '0 10px 30px rgba(120, 119, 198, 0.4)',
                transition: 'all 0.3s ease',
                border: 'none',
                cursor: 'pointer'
              }}
              onMouseOver={(e) => {
                e.target.style.transform = 'translateY(-2px)';
                e.target.style.boxShadow = '0 15px 40px rgba(120, 119, 198, 0.6)';
              }}
              onMouseOut={(e) => {
                e.target.style.transform = 'translateY(0)';
                e.target.style.boxShadow = '0 10px 30px rgba(120, 119, 198, 0.4)';
              }}
            >
              {lang === 'ar' ? 'ابدأ الآن' : 'GET STARTED'}
            </Link>

            <Link
              to="/dashboard"
              style={{
                background: 'transparent',
                color: '#ff77c6',
                padding: '16px 32px',
                borderRadius: '12px',
                textDecoration: 'none',
                fontWeight: '600',
                fontSize: '16px',
                border: '2px solid #ff77c6',
                transition: 'all 0.3s ease',
                cursor: 'pointer'
              }}
              onMouseOver={(e) => {
                e.target.style.background = '#ff77c6';
                e.target.style.color = 'white';
                e.target.style.transform = 'translateY(-2px)';
              }}
              onMouseOut={(e) => {
                e.target.style.background = 'transparent';
                e.target.style.color = '#ff77c6';
                e.target.style.transform = 'translateY(0)';
              }}
            >
              {lang === 'ar' ? 'جرب مجاناً' : 'START TRIAL'}
            </Link>
          </motion.div>
        </motion.div>
      </div>

      {/* Floating Elements */}
      <motion.div
        animate={{
          y: [0, -20, 0],
          rotate: [0, 5, 0]
        }}
        transition={{
          duration: 6,
          repeat: Infinity,
          ease: "easeInOut"
        }}
        style={{
          position: 'absolute',
          top: '20%',
          left: '10%',
          width: '20px',
          height: '20px',
          background: 'linear-gradient(135deg, #4facfe, #7877c6)',
          borderRadius: '50%',
          boxShadow: '0 0 20px rgba(79, 172, 254, 0.5)'
        }}
      />

      <motion.div
        animate={{
          y: [0, 20, 0],
          rotate: [0, -5, 0]
        }}
        transition={{
          duration: 8,
          repeat: Infinity,
          ease: "easeInOut",
          delay: 2
        }}
        style={{
          position: 'absolute',
          top: '60%',
          right: '15%',
          width: '15px',
          height: '15px',
          background: 'linear-gradient(135deg, #ff77c6, #7877c6)',
          borderRadius: '50%',
          boxShadow: '0 0 20px rgba(255, 119, 198, 0.5)'
        }}
      />

      <style jsx>{`
        @keyframes float {
          0%, 100% { transform: translateY(0px) rotate(0deg); }
          50% { transform: translateY(-20px) rotate(180deg); }
        }
      `}</style>
    </div>
  );
};

export default LandingPage;
